    let candidates = [];

    async function getCandidate(id) {
        let result = await props.VotingContract.getCandidate(id);
        candidates.push(result);
    }

    for (let i = 0; i < props.totalCount; i++) {
        getCandidate(i);
    }
    console.log(candidates);
